create database agendaTeste;

use agendaTeste;

create table contato (
id int auto_increment primary key,
nome varchar(64) not null,
email varchar(128),
telefone decimal(11,0),
foto_url varchar(256),
unique key (email)
);

alter table contato
change foto_url foto_url varchar(10000);

